import React from "react";
import whiteheart from "../../media/whiteheart.png";

const AddFavourite = () => {
    return (
        <>
            <span>Add to Favourites</span>
            <figure className="fav-white-heart fav-heart">
                <img src="../../media/whiteheart.png" />
            </figure>
        </>
    )
}

export default AddFavourite;
